import { useState } from "react";
import { TextField, Typography, Button } from "@material-ui/core";

export default function Register({ register, setIsLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");

  const handleRegister = () => {
    register(username, password, firstname, lastname);
  };

  return (
    <form>
      <Typography variant="h5" style={{ marginBottom: 8 }}>
        Login
      </Typography>
        <TextField label="Username:" variant="contained" className="form-input" fullwidth value={username} onChange={(e) => setUsername(e.target.value)} />
        <TextField value={password} onChange={(e) => setPassword(e.target.value)} />
        <TextField
            value={firstname}
            onChange={(e) => setFirstname(e.target.value)}
        />
        <TextField value={lastname} onChange={(e) => setLastname(e.target.value)} />
      <Button onClick={() => handleRegister()}>register</Button>
      <Button onClick={() => setIsLogin(true)}>login</Button>
    </form>
  );
}
